window.bookSummaryJSON = "<p><b>Audie Award Finalist, Original Work, 2016 </b></p> <p>Based on the best-selling, award-winning graphic novel series Locke &amp; Key - written by acclaimed suspense novelist Joe Hill (<i>NOS4A2</i>, <i>Horns</i>) and illustrated by Gabriel Rodriguez - this multicast, fully dramatized audio production brings the images and words to life.&nbsp;</p> <p>A brutal and tragic event drives the Locke family from their home in California to the relative safety of their ancestral estate in Lovecraft, Massachusetts, an old house with powerful keys and fantastic doors that transform all who dare to walk through them. As siblings Tyler, Kinsey, and Bode Locke discover the secrets of the old house, they also find that it's home to a hate-filled and relentless creature that will not rest until it forces open the most terrible door of them all....&nbsp;</p> <p>Featuring performances by Haley Joel Osment (<i>Entourage</i>, <i>The Sixth Sense</i>), Tatiana Maslany (<i>Orphan Black</i>), Kate Mulgrew (<i>Orange Is the New Black</i>, <i>Star Trek: Voyager</i>), Joe Hill, Gabriel Rodriguez, and Stephen King (<i>The Stand</i>, <i>11-22-63</i>), as well as a cast of more than 50 voice actors, this audio production preserves the heart-stopping impact of the graphic novel's astounding artwork through the use of richly imagined sound design and a powerful original score.&nbsp;</p> <p><b>*</b><b><i>Locke &amp; Key</i></b><b> contains explicit language and adult situations.</b>&nbsp;</p> <p>Experience this title in immersive 3D audio by setting your download quality to High within the app. Headphones recommended. For more, browse our entire collection of 3D audio listens.&nbsp;</p>"; 
